import { ModalContent, ModalHeader, ModalRoot } from "@utils/modal";
import { React } from "@webpack/common";
import { getStoredWallets, getCreatedCoins, getStoredTokenBalances, getPortfolioSummary, updateCreatedCoinStatus, type Wallet, type CreatedCoin, type TokenBalance } from "./storageHelper";

// Brand colors matching other modals
const BRAND_COLORS = {
    primary: "#F2F0E8", // Beige/Champagne base
    primaryDark: "#E8E5DD", // Darker beige
    accent1: "#E53E3E", // Red accent
    accent2: "#FBB040", // Yellow/Orange accent  
    accent3: "#38B2AC", // Teal accent
    charcoal: "#4A5568", // Charcoal grey
    success: "#38B2AC", // Teal for success states
    warning: "#FBB040", // Orange for warning states
    danger: "#E53E3E", // Red for danger states
    text: "#2D3748", // Dark text
    textMuted: "#718096", // Muted text
    lightText: "#E2E8F0", // Light text for dark backgrounds
    veryLightText: "#F7FAFC" // Very light text for dark backgrounds
};

// Padraig Branding
const PADRAIG_LOGO_BASE64 = "data:image/png;base64,";
interface PortfolioCommandCenterProps {
    transitionState: any;
}

interface PortfolioMetrics {
    totalValue: number;
    totalPnL: number;
    totalPnLPercentage: number;
    dayPnL: number;
    dayPnLPercentage: number;
    totalTrades: number;
    winRate: number;
    bestTrade: number;
    worstTrade: number;
}

interface TokenHolding {
    symbol: string;
    amount: number;
    value: number;
    pnl: number;
    pnlPercentage: number;
    price: number;
}

interface TradeActivity {
    type: "buy" | "sell";
    symbol: string;
    amount: number;
    price: number;
    value: number;
    timestamp: Date;
    txHash: string;
}

export function PortfolioCommandCenter({ transitionState }: PortfolioCommandCenterProps) {
    const [selectedTab, setSelectedTab] = React.useState<"overview" | "holdings" | "trades" | "analytics">("overview");
    const [wallets, setWallets] = React.useState<Wallet[]>([]);
    const [holdings, setHoldings] = React.useState<TokenBalance[]>([]);
    const [createdCoins, setCreatedCoins] = React.useState<CreatedCoin[]>([]);
    const [portfolioSummary, setPortfolioSummary] = React.useState({
        totalCoinsCreated: 0,
        totalTokensHeld: 0,
        pendingCoins: 0,
        confirmedCoins: 0
    });
    const [solBalances, setSolBalances] = React.useState<Record<string, number>>({});
    const [loading, setLoading] = React.useState(true);
    const [checkingStatus, setCheckingStatus] = React.useState(false);

    // SOL balance fetching function (same as WalletModal)
    const fetchSolBalance = async (publicKey: string): Promise<number> => {
        try {
            const response = await fetch("https://rpc.helius.xyz/?api-key=e3b54e60-daee-442f-8b75-1893c5be291f", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    jsonrpc: "2.0",
                    id: 1,
                    method: "getBalance",
                    params: [publicKey]
                })
            });

            const data = await response.json();
            if (data.result && typeof data.result.value === "number") {
                return data.result.value / 1e9; // Convert lamports to SOL
            }
            return 0;
        } catch (error) {
            console.error("[PortfolioCC] Failed to fetch SOL balance for", publicKey, error);
            return 0;
        }
    };

    // Transaction confirmation checking function
    const checkTransactionStatus = async (signature: string): Promise<{ confirmed: boolean; contractAddress?: string }> => {
        try {
            const response = await fetch("https://rpc.helius.xyz/?api-key=e3b54e60-daee-442f-8b75-1893c5be291f", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    jsonrpc: "2.0",
                    id: 1,
                    method: "getTransaction",
                    params: [
                        signature,
                        {
                            encoding: "json",
                            commitment: "confirmed",
                            maxSupportedTransactionVersion: 0
                        }
                    ]
                })
            });

            const data = await response.json();
            if (data.result && data.result.meta && !data.result.meta.err) {
                // Transaction confirmed successfully
                let contractAddress = null;
                
                // Try to extract contract address from transaction logs
                if (data.result.meta.logMessages) {
                    for (const log of data.result.meta.logMessages) {
                        if (log.includes("Program") && log.includes("invoke")) {
                            // This is a simplified extraction - the actual mint address might be in postTokenBalances
                            break;
                        }
                    }
                }
                
                // Try to get contract address from postTokenBalances
                if (data.result.meta.postTokenBalances && data.result.meta.postTokenBalances.length > 0) {
                    const newToken = data.result.meta.postTokenBalances.find((balance: any) => 
                        !data.result.meta.preTokenBalances?.some((preBalance: any) => preBalance.mint === balance.mint)
                    );
                    if (newToken) {
                        contractAddress = newToken.mint;
                    }
                }
                
                return { confirmed: true, contractAddress: contractAddress || undefined };
            } else if (data.result === null) {
                // Transaction not found or not confirmed yet
                return { confirmed: false };
            } else if (data.result.meta.err) {
                // Transaction failed
                console.log("[PortfolioCC] Transaction failed:", signature, data.result.meta.err);
                return { confirmed: false };
            }
            
            return { confirmed: false };
        } catch (error) {
            console.error("[PortfolioCC] Failed to check transaction status for", signature, error);
            return { confirmed: false };
        }
    };

    // Check and update pending coin statuses
    const updatePendingCoinStatuses = async () => {
        const pendingCoins = createdCoins.filter(coin => coin.status === "pending" && coin.transactionSignature);
        
        if (pendingCoins.length === 0) {
            console.log("[PortfolioCC] No pending coins to check");
            return;
        }
        
        setCheckingStatus(true);
        console.log(`[PortfolioCC] Checking status for ${pendingCoins.length} pending coins...`);
        
        let updatesCount = 0;
        
        for (const coin of pendingCoins) {
            try {
                const { confirmed, contractAddress } = await checkTransactionStatus(coin.transactionSignature);
                
                if (confirmed) {
                    console.log(`[PortfolioCC] Coin ${coin.name} confirmed! Contract: ${contractAddress}`);
                    await updateCreatedCoinStatus(coin.id, "confirmed", contractAddress || undefined);
                    updatesCount++;
                }
            } catch (error) {
                console.error(`[PortfolioCC] Failed to update status for coin ${coin.name}:`, error);
            }
        }
        
        // Reload the coins data to reflect updates
        if (updatesCount > 0) {
            console.log(`[PortfolioCC] Updated ${updatesCount} coins to confirmed status`);
            const updatedCoins = await getCreatedCoins();
            setCreatedCoins(updatedCoins);
            
            // Update portfolio summary
            const updatedSummary = await getPortfolioSummary();
            setPortfolioSummary(updatedSummary);
        }
        
        setCheckingStatus(false);
    };

    // Load real data on component mount
    React.useEffect(() => {
        const loadPortfolioData = async () => {
            try {
                setLoading(true);
                const [walletsData, coinsData, summaryData] = await Promise.all([
                    getStoredWallets(),
                    getCreatedCoins(),
                    getPortfolioSummary()
                ]);

                setWallets(walletsData);
                setCreatedCoins(coinsData);
                setPortfolioSummary(summaryData);

                // Load token holdings and SOL balances for all wallets
                const allHoldings: TokenBalance[] = [];
                const solBalanceMap: Record<string, number> = {};
                
                for (const wallet of walletsData) {
                    if (wallet.publicKey) {
                        try {
                            // Load token balances
                            const balances = await getStoredTokenBalances(wallet.publicKey);
                            allHoldings.push(...balances);
                        } catch (error) {
                            console.warn("Failed to load token balances for wallet:", wallet.name, "- this is normal if no token balances have been stored yet");
                        }
                        
                        try {
                            // Load SOL balance
                            const solBalance = await fetchSolBalance(wallet.publicKey);
                            solBalanceMap[wallet.id] = solBalance;
                            console.log(`[PortfolioCC] Loaded SOL balance for ${wallet.name}: ${solBalance} SOL`);
                        } catch (error) {
                            console.warn("Failed to load SOL balance for wallet:", wallet.name, error);
                            solBalanceMap[wallet.id] = 0;
                        }
                    }
                }
                
                setHoldings(allHoldings);
                setSolBalances(solBalanceMap);
                
                // Check for pending coin status updates
                setTimeout(updatePendingCoinStatuses, 1000); // Check after a brief delay
            } catch (error) {
                console.error("Failed to load portfolio data:", error);
            } finally {
                setLoading(false);
            }
        };

        loadPortfolioData();
    }, []);

    // Calculate portfolio metrics from real data (including SOL balances)
    const totalSolValue = Object.values(solBalances).reduce((sum, balance) => sum + balance, 0);
    const totalTokenValue = holdings.reduce((sum, h) => sum + ((h.uiAmount || 0) * 0.001), 0); // Rough estimate for tokens
    
    const portfolioMetrics: PortfolioMetrics = {
        totalValue: totalSolValue + totalTokenValue, // Real SOL + estimated token value
        totalPnL: 0, // Would need historical data
        totalPnLPercentage: 0,
        dayPnL: 0,
        dayPnLPercentage: 0,
        totalTrades: createdCoins.length,
        winRate: createdCoins.length > 0 ? (portfolioSummary.confirmedCoins / createdCoins.length) * 100 : 0,
        bestTrade: 0,
        worstTrade: 0
    };

    // Convert token balances to holdings format (with safety checks)
    const topHoldings: TokenHolding[] = holdings
        .slice(0, 10)
        .map(balance => ({
            symbol: balance.tokenInfo?.symbol || (balance.mint ? balance.mint.substring(0, 8) : "UNKNOWN"),
            amount: balance.uiAmount || 0,
            value: (balance.uiAmount || 0) * 0.001, // Rough estimate
            pnl: 0, // Would need historical data
            pnlPercentage: 0,
            price: 0.001 // Rough estimate
        }));

    // Convert created coins to trade activities (with safety checks)
    const recentTrades: TradeActivity[] = createdCoins
        .slice(0, 10)
        .map(coin => ({
            type: "buy" as const,
            symbol: coin.symbol || "UNKNOWN",
            amount: 1000000, // Default amount
            price: 0.001,
            value: 1000,
            timestamp: new Date(coin.createdAt || Date.now()),
            txHash: coin.transactionSignature || "pending"
        }));

    const formatSOL = (amount: number) => `${amount.toFixed(3)} SOL`;
    const formatPercentage = (percent: number) => `${percent > 0 ? '+' : ''}${percent.toFixed(1)}%`;
    const formatNumber = (num: number) => num.toLocaleString();

    return (
        <ModalRoot transitionState={transitionState}>
            <ModalHeader>
                <div style={{
                    display: "flex",
                    alignItems: "center",
                    gap: "12px"
                }}>
                    {/* Logo */}
                    <div style={{
                        width: "32px",
                        height: "32px",
                        background: `linear-gradient(135deg, ${BRAND_COLORS.accent2}, ${BRAND_COLORS.accent1})`,
                        borderRadius: "8px",
                        display: "flex",
                        alignItems: "center",
                        justifyContent: "center",
                        overflow: "hidden"
                    }}>
                        <img
                            src={PADRAIG_LOGO_BASE64}
                            alt="PadraigAIO"
                            style={{
                                width: "100%",
                                height: "100%",
                                objectFit: "cover"
                            }}
                        />
                    </div>

                    <div>
                        <h2 style={{
                            margin: 0,
                            fontSize: "20px",
                            fontWeight: "600",
                            color: BRAND_COLORS.veryLightText
                        }}>
                            Portfolio Command Center
                        </h2>
                        <p style={{
                            margin: 0,
                            fontSize: "14px",
                            color: BRAND_COLORS.lightText
                        }}>
                            Real-time portfolio analytics and performance tracking
                        </p>
                    </div>
                </div>
            </ModalHeader>

            <ModalContent style={{ padding: "20px", maxHeight: "70vh", overflow: "hidden" }}>
                {/* Tab Navigation */}
                <div style={{
                    display: "flex",
                    borderBottom: "1px solid var(--background-modifier-accent)",
                    marginBottom: "20px"
                }}>
                    {[
                        { id: "overview", label: " Overview", icon: "" },
                        { id: "holdings", label: " Holdings", icon: "" },
                        { id: "trades", label: " Trades", icon: "" },
                        { id: "analytics", label: " Analytics", icon: "" }
                    ].map((tab) => (
                        <button
                            key={tab.id}
                            onClick={() => setSelectedTab(tab.id as any)}
                            style={{
                                padding: "12px 16px",
                                border: "none",
                                background: "transparent",
                                color: selectedTab === tab.id ? BRAND_COLORS.accent2 : BRAND_COLORS.lightText,
                                borderBottom: selectedTab === tab.id ? `2px solid ${BRAND_COLORS.accent2}` : "2px solid transparent",
                                cursor: "pointer",
                                fontSize: "14px",
                                fontWeight: "500",
                                transition: "all 0.2s ease"
                            }}
                        >
                            {tab.label}
                        </button>
                    ))}
                </div>

                {/* Tab Content */}
                <div style={{ overflow: "auto", maxHeight: "calc(70vh - 120px)" }}>
                    {loading && (
                        <div style={{
                            display: "flex",
                            justifyContent: "center",
                            alignItems: "center",
                            padding: "40px",
                            color: BRAND_COLORS.lightText
                        }}>
                            Loading portfolio data...
                        </div>
                    )}
                    {!loading && selectedTab === "overview" && (
                        <div>
                            {/* Key Metrics Cards */}
                            <div style={{
                                display: "grid",
                                gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))",
                                gap: "16px",
                                marginBottom: "24px"
                            }}>
                                {/* Total Portfolio Value */}
                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "16px",
                                    borderRadius: "12px",
                                    border: `1px solid ${BRAND_COLORS.accent2}20`
                                }}>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText, marginBottom: "4px" }}>
                                        Total Portfolio Value
                                    </div>
                                    <div style={{ fontSize: "24px", fontWeight: "700", color: BRAND_COLORS.veryLightText }}>
                                        {formatSOL(portfolioMetrics.totalValue)}
                                    </div>
                                    <div style={{ 
                                        fontSize: "12px", 
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        {formatSOL(totalSolValue)} SOL + {formatSOL(totalTokenValue)} Tokens
                                    </div>
                                </div>

                                {/* 24h P&L */}
                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "16px",
                                    borderRadius: "12px",
                                    border: `1px solid ${portfolioMetrics.dayPnL >= 0 ? BRAND_COLORS.success : BRAND_COLORS.danger}20`
                                }}>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText, marginBottom: "4px" }}>
                                        Created Coins
                                    </div>
                                    <div style={{
                                        fontSize: "20px",
                                        fontWeight: "600",
                                        color: BRAND_COLORS.veryLightText
                                    }}>
                                        {portfolioSummary.totalCoinsCreated}
                                    </div>
                                    <div style={{
                                        fontSize: "12px",
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        {portfolioSummary.confirmedCoins} confirmed, {portfolioSummary.pendingCoins} pending
                                    </div>
                                </div>

                                {/* Win Rate */}
                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "16px",
                                    borderRadius: "12px",
                                    border: `1px solid ${BRAND_COLORS.accent3}20`
                                }}>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText, marginBottom: "4px" }}>
                                        Success Rate
                                    </div>
                                    <div style={{ fontSize: "20px", fontWeight: "600", color: BRAND_COLORS.accent3 }}>
                                        {portfolioMetrics.winRate.toFixed(1)}%
                                    </div>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                        {portfolioMetrics.totalTrades} total coins
                                    </div>
                                </div>

                                {/* Best Trade */}
                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "16px",
                                    borderRadius: "12px",
                                    border: `1px solid ${BRAND_COLORS.success}20`
                                }}>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText, marginBottom: "4px" }}>
                                        Active Wallets
                                    </div>
                                    <div style={{ fontSize: "20px", fontWeight: "600", color: BRAND_COLORS.success }}>
                                        {wallets.length}
                                    </div>
                                    <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                        {holdings.length} token holdings
                                    </div>
                                </div>
                            </div>

                            {/* Top Holdings Preview */}
                            <div style={{
                                background: "var(--background-secondary)",
                                padding: "20px",
                                borderRadius: "12px",
                                marginBottom: "20px"
                            }}>
                                <h3 style={{ margin: "0 0 16px 0", fontSize: "16px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                     Top Holdings
                                </h3>
                                {topHoldings.length > 0 ? topHoldings.slice(0, 3).map((holding, index) => (
                                    <div key={holding.symbol} style={{
                                        display: "flex",
                                        justifyContent: "space-between",
                                        alignItems: "center",
                                        padding: "8px 0",
                                        borderBottom: index < 2 ? "1px solid var(--background-modifier-accent)" : "none"
                                    }}>
                                        <div>
                                            <div style={{ fontWeight: "600", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                {holding.symbol}
                                            </div>
                                            <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                                {formatNumber(holding.amount)} tokens
                                            </div>
                                        </div>
                                        <div style={{ textAlign: "right" }}>
                                            <div style={{ fontWeight: "500", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                {formatNumber(holding.amount)}
                                            </div>
                                            <div style={{
                                                fontSize: "12px",
                                                color: holding.pnl >= 0 ? BRAND_COLORS.success : BRAND_COLORS.danger
                                            }}>
                                                {formatPercentage(holding.pnlPercentage)}
                                            </div>
                                        </div>
                                    </div>
                                )) : (
                                    <div style={{
                                        textAlign: "center",
                                        padding: "20px",
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        No token holdings found. Token balances will appear here once you have tokens in your wallets.
                                    </div>
                                )}
                                <button
                                    onClick={() => setSelectedTab("holdings")}
                                    style={{
                                        width: "100%",
                                        padding: "8px",
                                        marginTop: "12px",
                                        background: "transparent",
                                        border: `1px solid ${BRAND_COLORS.accent2}`,
                                        borderRadius: "6px",
                                        color: BRAND_COLORS.accent2,
                                        cursor: "pointer",
                                        fontSize: "12px"
                                    }}
                                >
                                    View All Holdings
                                </button>
                            </div>

                            {/* Recent Activity Preview */}
                            <div style={{
                                background: "var(--background-secondary)",
                                padding: "20px",
                                borderRadius: "12px"
                            }}>
                                <h3 style={{ margin: "0 0 16px 0", fontSize: "16px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                     Recent Coin Creation
                                </h3>
                                {recentTrades.slice(0, 3).map((trade, index) => (
                                    <div key={index} style={{
                                        display: "flex",
                                        justifyContent: "space-between",
                                        alignItems: "center",
                                        padding: "8px 0",
                                        borderBottom: index < 2 ? "1px solid var(--background-modifier-accent)" : "none"
                                    }}>
                                        <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
                                            <span style={{
                                                width: "20px",
                                                height: "20px",
                                                borderRadius: "4px",
                                                background: trade.type === "buy" ? BRAND_COLORS.success : BRAND_COLORS.danger,
                                                display: "flex",
                                                alignItems: "center",
                                                justifyContent: "center",
                                                fontSize: "10px"
                                            }}>
                                                {trade.type === "buy" ? "+" : "-"}
                                            </span>
                                            <div>
                                                <div style={{ fontWeight: "600", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                    CREATE {trade.symbol}
                                                </div>
                                                <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                                    {new Date(trade.timestamp).toLocaleDateString()}
                                                </div>
                                            </div>
                                        </div>
                                        <div style={{ textAlign: "right" }}>
                                            <div style={{ fontWeight: "500", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                {trade.txHash.substring(0, 8)}...
                                            </div>
                                            <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                                Created
                                            </div>
                                        </div>
                                    </div>
                                ))}
                                <button
                                    onClick={() => setSelectedTab("trades")}
                                    style={{
                                        width: "100%",
                                        padding: "8px",
                                        marginTop: "12px",
                                        background: "transparent",
                                        border: `1px solid ${BRAND_COLORS.accent2}`,
                                        borderRadius: "6px",
                                        color: BRAND_COLORS.accent2,
                                        cursor: "pointer",
                                        fontSize: "12px"
                                    }}
                                >
                                    View All Trades
                                </button>
                            </div>
                        </div>
                    )}

                    {!loading && selectedTab === "holdings" && (
                        <div>
                            <h3 style={{ margin: "0 0 20px 0", fontSize: "18px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                 All Holdings ({holdings.length})
                            </h3>
                            <div style={{ display: "flex", flexDirection: "column", gap: "12px" }}>
                                {topHoldings.length > 0 ? topHoldings.map((holding) => (
                                    <div key={holding.symbol} style={{
                                        background: "var(--background-secondary)",
                                        padding: "16px",
                                        borderRadius: "12px",
                                        display: "flex",
                                        justifyContent: "space-between",
                                        alignItems: "center"
                                    }}>
                                        <div>
                                            <div style={{ fontWeight: "600", fontSize: "16px", marginBottom: "4px", color: BRAND_COLORS.veryLightText }}>
                                                {holding.symbol}
                                            </div>
                                            <div style={{ fontSize: "14px", color: BRAND_COLORS.lightText }}>
                                                {formatNumber(holding.amount)} tokens
                                            </div>
                                        </div>
                                        <div style={{ textAlign: "right" }}>
                                            <div style={{ fontWeight: "600", fontSize: "16px", marginBottom: "4px", color: BRAND_COLORS.veryLightText }}>
                                                {formatNumber(holding.amount)}
                                            </div>
                                            <div style={{
                                                fontSize: "14px",
                                                color: holding.pnl >= 0 ? BRAND_COLORS.success : BRAND_COLORS.danger
                                            }}>
                                                {formatSOL(holding.pnl)} ({formatPercentage(holding.pnlPercentage)})
                                            </div>
                                        </div>
                                    </div>
                                )) : (
                                    <div style={{
                                        textAlign: "center",
                                        padding: "40px",
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        No token holdings found. This section will show your token balances once you have tokens in your wallets.
                                    </div>
                                )}
                            </div>
                            
                            {/* SOL Balances Section */}
                            <h3 style={{ margin: "30px 0 20px 0", fontSize: "18px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                 SOL Balances ({wallets.length} wallets)
                            </h3>
                            <div style={{ display: "flex", flexDirection: "column", gap: "12px" }}>
                                {wallets.length > 0 ? wallets.map((wallet) => (
                                    <div key={wallet.id} style={{
                                        background: "var(--background-secondary)",
                                        padding: "16px",
                                        borderRadius: "12px",
                                        display: "flex",
                                        justifyContent: "space-between",
                                        alignItems: "center"
                                    }}>
                                        <div>
                                            <div style={{ fontWeight: "600", fontSize: "16px", marginBottom: "4px", color: BRAND_COLORS.veryLightText }}>
                                                {wallet.name}
                                            </div>
                                            <div style={{ fontSize: "14px", color: BRAND_COLORS.lightText }}>
                                                {wallet.publicKey ? wallet.publicKey.substring(0, 8) + "..." : "No Public Key"}
                                            </div>
                                        </div>
                                        <div style={{ textAlign: "right" }}>
                                            <div style={{ fontWeight: "600", fontSize: "16px", marginBottom: "4px", color: BRAND_COLORS.veryLightText }}>
                                                {formatSOL(solBalances[wallet.id] || 0)}
                                            </div>
                                            <div style={{
                                                fontSize: "14px",
                                                color: BRAND_COLORS.lightText
                                            }}>
                                                SOL Balance
                                            </div>
                                        </div>
                                    </div>
                                )) : (
                                    <div style={{
                                        textAlign: "center",
                                        padding: "40px",
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        No wallets found. Add wallets to see SOL balances.
                                    </div>
                                )}
                            </div>
                        </div>
                    )}

                    {!loading && selectedTab === "trades" && (
                        <div>
                            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "20px" }}>
                                <h3 style={{ margin: 0, fontSize: "18px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                     Coin Creation History ({createdCoins.length})
                                </h3>
                                <button
                                    onClick={updatePendingCoinStatuses}
                                    disabled={checkingStatus}
                                    style={{
                                        padding: "8px 12px",
                                        background: checkingStatus ? BRAND_COLORS.charcoal : BRAND_COLORS.accent2,
                                        border: "none",
                                        borderRadius: "6px",
                                        color: "white",
                                        cursor: checkingStatus ? "not-allowed" : "pointer",
                                        fontSize: "12px",
                                        fontWeight: "500",
                                        opacity: checkingStatus ? 0.7 : 1
                                    }}
                                >
                                    {checkingStatus ? " Checking..." : " Check Status"}
                                </button>
                            </div>
                            <div style={{ display: "flex", flexDirection: "column", gap: "8px" }}>
                                {createdCoins.length > 0 ? createdCoins.map((coin) => (
                                    <div key={coin.id} style={{
                                        background: "var(--background-secondary)",
                                        padding: "16px",
                                        borderRadius: "12px",
                                        display: "flex",
                                        justifyContent: "space-between",
                                        alignItems: "center"
                                    }}>
                                        <div style={{ display: "flex", alignItems: "center", gap: "12px" }}>
                                            <span style={{
                                                width: "32px",
                                                height: "32px",
                                                borderRadius: "8px",
                                                background: coin.status === "confirmed" ? BRAND_COLORS.success : coin.status === "pending" ? BRAND_COLORS.warning : BRAND_COLORS.danger,
                                                display: "flex",
                                                alignItems: "center",
                                                justifyContent: "center",
                                                fontSize: "14px",
                                                fontWeight: "600"
                                            }}>
                                                {coin.status === "confirmed" ? "" : coin.status === "pending" ? "" : ""}
                                            </span>
                                            <div>
                                                <div style={{ fontWeight: "600", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                    {coin.name} ({coin.symbol})
                                                </div>
                                                <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                                    Status: {coin.status}  {new Date(coin.createdAt).toLocaleDateString()}
                                                </div>
                                            </div>
                                        </div>
                                        <div style={{ textAlign: "right" }}>
                                            <div style={{ fontWeight: "500", fontSize: "14px", color: BRAND_COLORS.veryLightText }}>
                                                {coin.contractAddress ? coin.contractAddress.substring(0, 8) + "..." : "Pending"}
                                            </div>
                                            <div style={{ fontSize: "12px", color: BRAND_COLORS.lightText }}>
                                                {coin.transactionSignature ? coin.transactionSignature.substring(0, 8) + "..." : "No TX"}
                                            </div>
                                        </div>
                                    </div>
                                )) : (
                                    <div style={{
                                        textAlign: "center",
                                        padding: "40px",
                                        color: BRAND_COLORS.lightText
                                    }}>
                                        No coins created yet. This section will show your coin creation history once you create your first token.
                                    </div>
                                )}
                            </div>
                        </div>
                    )}

                    {!loading && selectedTab === "analytics" && (
                        <div>
                            <h3 style={{ margin: "0 0 20px 0", fontSize: "18px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                 Performance Analytics
                            </h3>
                            <div style={{
                                display: "grid",
                                gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
                                gap: "16px"
                            }}>
                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "20px",
                                    borderRadius: "12px"
                                }}>
                                    <h4 style={{ margin: "0 0 16px 0", fontSize: "16px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                        Wallet Overview
                                    </h4>
                                    <div style={{ display: "flex", flexDirection: "column", gap: "12px" }}>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Total Wallets:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.veryLightText }}>{wallets.length}</span>
                                        </div>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Active Holdings:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.success }}>{holdings.length}</span>
                                        </div>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Created Coins:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.veryLightText }}>{createdCoins.length}</span>
                                        </div>
                                    </div>
                                </div>

                                <div style={{
                                    background: "var(--background-secondary)",
                                    padding: "20px",
                                    borderRadius: "12px"
                                }}>
                                    <h4 style={{ margin: "0 0 16px 0", fontSize: "16px", fontWeight: "600", color: BRAND_COLORS.veryLightText }}>
                                        Creation Statistics
                                    </h4>
                                    <div style={{ display: "flex", flexDirection: "column", gap: "12px" }}>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Success Rate:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.success }}>{portfolioMetrics.winRate.toFixed(1)}%</span>
                                        </div>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Confirmed:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.veryLightText }}>{portfolioSummary.confirmedCoins}</span>
                                        </div>
                                        <div style={{ display: "flex", justifyContent: "space-between" }}>
                                            <span style={{ color: BRAND_COLORS.lightText }}>Pending:</span>
                                            <span style={{ fontWeight: "600", color: BRAND_COLORS.warning }}>{portfolioSummary.pendingCoins}</span>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            </ModalContent>
        </ModalRoot>
    );
}